    public function onEnable(){
        $this->level = $this->getServer()->getDefaultLevel();
        $this->setArenasData();
        $this->registerArena("arena1");
        /*foreach($this->getServer()->getLevels() as $level){
            foreach($level->getEntities() as $entity){
                $entity->close();
            }
            $this->spawnNPCs();
        }*/
    }
    
    public function onDisable(){
        foreach($this->getServer()->getLevels() as $level){
            foreach($level->getEntities() as $entity){
                if(!$entity instanceof Player){
                    $entity->close();
                }
            }
            $this->spawnNPCs();
        }
    }
    
    public function registerArena($arena){
        $a = new Arena($arena, $this);
        $a->data = $this->arenas[$arena];
        $this->getServer()->getPluginManager()->registerEvents($a, $this);
    }
    
    public function getPrefix(){
        return TextFormat::GOLD."[ZombieSurvival] ";
    }
    
    public function setArenasData(){
        $this->arenas = ['arena1' => ['world' => "zs", 
            'pspawns' => [], 
            'zspawns' => [], 
            "joinsign" => new Vector3(-1438, 34, 912)]];
    }
    
    public function getNBT(Position $pos, $name, $yaw, $pitch){
    $pos = new Location($pos->x, $pos->y, $pos->z, 0.0, 0.0, $pos->level);
    $nbt = new Compound;
    $nbt->NameTag = new String("name", $name);
    $nbt->Pos = new Enum("Pos", [
            new Double(0, $pos->x),
            new Double(1, $pos->y),
            new Double(2, $pos->z),
    ]);
    $nbt->Motion = new Enum("Motion", [
            new Double(0, 0.0),
            new Double(1, 0.0),
            new Double(2, 0.0),
    ]);
    $nbt->Rotation = new Enum("Rotation", [
            new Float(0, $yaw),
            new Float(1, $pitch)
    ]);
    $nbt->FallDistance = new Float("FallDistance", 0.0);
    $nbt->Fire = new Short("Fire", 0);
    $nbt->Air = new Short("Air", 0);
    $nbt->OnGround = new Byte("OnGround", 1);
    $nbt->Invulnerable = new Byte("Invulnerable", 1);
    $nbt->Health = new Short("Health", 20);
    return $nbt;
    }
    
